    false,nt"url": null,nt"notes": "This annual narrative report for Ottawa
    National Wildlife Refuge Complex outlines Refuge accomplishments during the 1996
    calendar year.  The report begins with a summary of the year's highlights and weather
    conditions. Land acquisition is covered. The report includes a planning section
    which discusses research and investigations. Refuge administration is outlined;
    information about personnel, youth programs, volunteer programs, funding, and safety
    is given. Habitat management is also covered; subjects include wetlands, croplands,
    and pest control. The wildlife section of the report discusses wildlife diversity,
    endangered and threatened species, marsh birds and waterbirds, shorebirds, raptors,
    game mammals, and fisheries resources. The public uses of the Refuge described in
    this report include interpretive programs, hunting, and trapping. The equipment
    and facilities section of the report provides information about new construction,
    rehabilitation, major maintenance, equipment replacement, and computer systems.",nt"license_title":
